import React from "react";
import { Routes, Route , Router} from "react-router-dom";
import Home from "./components/Home"

const App = () => {
  return(
    <>
      <Router>
        <div>
          <Routes>
            {/* <Route path="/login" />
            <Route path="/register" /> */}
            <Route path="/" component={<Home />} />
          </Routes>
        </div>
      </Router>
    </>
  )
};

export default App;
